import { NgModule } from '@angular/core';
import { SharedModule } from 'app/shared/shared.module';

import { PayrollRecordRoutingModule } from './route/payroll-routing.module';
import { PayrollComponent } from './payroll.component';

import { CreatePayrollComponent } from './create-payroll/create-payroll.component';
import { ViewPayrollComponent } from './view-payroll/view-payroll.component';

import { CommonModule } from '@angular/common';
import { TabMenuModule } from 'primeng/tabmenu';
import { DialogModule } from 'primeng/dialog';
import { PanelModule } from 'primeng/panel';
import { DropdownModule } from 'primeng/dropdown';
import { FormsModule, ReactiveFormsModule } from '@angular/forms';
import { InputTextModule } from 'primeng/inputtext';
import { MultiSelectModule } from 'primeng/multiselect';
import { TableModule } from 'primeng/table';
import { ButtonModule } from 'primeng/button';
import { ConfirmPopupModule } from 'primeng/confirmpopup';
import { ToastModule } from 'primeng/toast';
import { TagModule } from 'primeng/tag';
import { RippleModule } from 'primeng/ripple';
import { DataEntryService } from 'app/workload/payroll-verifier/data-entry/service/data-entry.service';
import { ConfirmationService, MessageService } from 'primeng/api';
import { DateUtilsService } from 'app/core/util/date-utils.service';
import { DialogService } from 'primeng/dynamicdialog';
import { NspConfirmationService } from 'app/shared/confirm/nsp-confirm.service';
import { TabViewModule } from 'primeng/tabview';
import { CalendarModule } from 'primeng/calendar';
import {InputNumberModule} from 'primeng/inputnumber';
import { AccordionModule } from 'primeng/accordion';
import {InputTextareaModule} from 'primeng/inputtextarea';
import {CheckboxModule} from 'primeng/checkbox';

import { IcCodeService } from 'app/ng-connect';
import { ExportUtilsService } from 'app/core/util/export-utils.service';
import { ViewPayrollDetailComponent } from './view-payroll-detail/view-payroll-detail.component';

@NgModule({
  imports: [
    SharedModule,
    PayrollRecordRoutingModule,
    CalendarModule,
    CommonModule,
    TabMenuModule,
    DialogModule,
    PanelModule,
    DropdownModule,
    FormsModule,
    ReactiveFormsModule,
    InputTextModule,
    InputNumberModule,
    MultiSelectModule,
    TableModule,
    ButtonModule,
    ConfirmPopupModule,
    ToastModule,
    TagModule,
    RippleModule,
    TabViewModule,
    AccordionModule,
    InputTextareaModule,
    CheckboxModule
  ],
  declarations: [PayrollComponent, CreatePayrollComponent, ViewPayrollComponent, ViewPayrollDetailComponent],
  providers: [
    DataEntryService,
    ConfirmationService,
    MessageService,
    DateUtilsService,
    DialogService,
    NspConfirmationService,
    IcCodeService,
    ExportUtilsService
  ],
  entryComponents: []
}
)

export class PayrollModule { }
